import React, { Component } from 'react';
import { productsList } from '../data/productsList';

export default class HomePage extends Component {

  render() {

    return (
      <div>
        <h2>All Products</h2>
        <h3> There are {productsList.length } products in store  </h3>
        <ul>
            { productsList.map((innerItem, i) => <li> {innerItem.description}  </li>) }
        </ul>
      </div>
    );
  }
}
